class AppConfig {
    public dataPort = 4000;
    public baseUrl = "http://localhost:" + this.dataPort ;
    public clocksUrl = this.baseUrl + "/data/clocks";
    public germanyTimeUrl = "http://worldtimeapi.org/api/timezone/Europe/Germany";
}

const appConfig = new AppConfig();

export default appConfig;
